"""graduation_notice.py
Simple script to show a notice that the bot has "graduated"."""
import base64
from io import BytesIO
from nextcord.ext import commands
from nextcord.activity import Activity, ActivityType
import logging

# Set up logging
logger = logging.getLogger(__name__)
# The bot has a profile picture with a fancy hat. Here, we create it
GRADUATION_PROFILE_PICTURE_DATA = """"""
GRADUATION_PROFILE_PICTURE = base64.b64decode(GRADUATION_PROFILE_PICTURE_DATA)


class GraduationNotice(commands.Cog):
    def __init__(self, bot: commands.Bot):
        self.bot = bot

    @commands.Cog.listener()
    async def on_ready(self):
        """Runs when the bot is ready and sets the status."""
        logger.info("Bot has been started. Changing stuff...")
        await self.bot.change_presence(
            activity=Activity(
                type=ActivityType.watching,
                name="SSIS-servern. Jag har tagit studenten!",
            )
        )
        logger.info("Status changed. Editing avatar...")
        await self.bot.user.edit(avatar=GRADUATION_PROFILE_PICTURE)
